Last night I hosted my first (of hopefully many) fundraisers for Israel 🇮🇱 It was so magical and could not have happened without @catkorren @jacquelinekorren @rifkeeb @neshamah_137 who led the most powerful night of prayer. I woke up today on a high from last night; the energy, the love, the vibe, the discussion everything was so meaningful, cathartic & beautiful. Grateful to have such amazing friends & partners who helped my vision of this night become reality. 

The evening raised $9763 which was doubled by an anonymous donor to $19,526. Then a 2nd anonymous donor added $25,000 to that making the grand total raised $44,526 going directly into the @ujafedny Israel Emergency Fund.

THANK YOU to all of the brands & local businesses who contributed to the silent auction and helped us reach our goal!
